interface BodyProps{
    msg: string;
    msg_esp?: string;
}

const Body: React.FC<BodyProps> = (props) => {
    let contador = 1;

    function buttonClick(){
        contador++;
    }

    return (
        <>
        <h1>{ props.msg }</h1>
        <h2>{ contador++ }</h2>
        <button onClick={buttonClick}>ATUALIZAR</button>
        </>
    )
}
export default Body;
